import "./UpdateProfile.css";
const UpdateProfile = () => {
  return (
    <>
      <main id="container3">
        <form>
          <label>Email:</label>
          <input placeholder="Update Email"></input>
          <label>Name:</label>
          <input placeholder="Update Name"></input>
          <label>Avatar:</label>
          <input placeholder="Update Avatar"></input>
        </form>
      </main>
    </>
  );
};

export default UpdateProfile;
